    "2016-07-27T22:18:24.626886",nt"name": "on-site-toxicity-of-irrigation-drainwater-from-stillwater-national-wildlife-refuge-to-aqua",nt"isopen":
    false,nt"url": null,nt"notes": "The toxicity of water from seven locations
    in the Stillwater Wildlife Management Area was evaluated in a series of on-site
    tests conducted over a 10 day period with bluegill, larval fathead minnows, and
    daphnids.  TJ brain and Hunter Drain were identified as locations with the greatest
    toxicity problems. Mortality was high for all species at these locations and no
    organisms survived exposure to full-strength or 50% drainwater from Hunter Drain.
     Water quality of Hunter and TJ drains fluctuated dramatically during the 10-day
